    "descr": "Health psychology is a rapidly expanding discipline at the interface of psychology and clinical medicine. This new edition is fully reworked and revised, offering an entirely up-to-date, comprehensive, accessible, one-stop resource for clinical psychologists, mental health professionals and specialists in health-related matters. There are two new editors: Susan Ayers from the University of Sussex and Kenneth Wallston from Vanderbilt University Medical Center. The prestigious editorial team and their international, interdisciplinary cast of authors have reconceptualised their much-acclaimed handbook. The book is now in two parts: part I covers psychological aspects of health and illness, assessments, interventions and healthcare practice. Part II covers medical matters listed in alphabetical order. Among the many new topics added are: diet and health, ethnicity and health, clinical inrterviewing, mood assessment, communicating risk, medical interviewing, diagnostic procedures, organ donation, IVF, MMR, HRT, sleep disorders, skin disorders, depression and anxiety disorders.",
