    "descr": "Настоящая книга является четвертым изданием, переработанным и значительно дополненным. В ней приведен полный список анатомических терминов на латинском и русском языках, расположенных по системам организма и органам. Список латинских терминов соответствует Международной Парижской анатомической номенклатуре с дополнениями, внесенными на последующих анатомических конгрессах, включая X Международный анатомический конгресс в Токио (1975). Русские анатомические термины соответствуют терминам Международной анатомической номенклатуры. Список русских терминов подготовлен комиссией, назначенной приказом министра здравоохранения СССР, одобрен терминологической комиссией Президиума АМН СССР и утвержден в качестве официального VIII Всесоюзным съездом анатомов, гистологов и эмбриологов. Книга рассчитана на широкий круг врачей разных специальностей, редакционных работников.",
