    "descr": "Focusing on discrete models across a variety of biological subdisciplines, this introductory textbook includes linear and non-linear models of populations, Markov models of molecular evolution, phylogenetic tree construction from DNA sequence data, genetics, and infectious disease models. Assuming no knowledge of calculus, the development of mathematical topics, such as matrix algebra and basic probability, is motivated by the biological models. Computer research with MATLAB is incorporated throughout in exercises and more extensive projects to provide readers with actual experience with the mathematical models.",
